import React from "react";
import { Link } from "react-router-dom";
import { Box, ListItemIcon, Typography } from "@mui/material";
import { useState, useEffect } from "react";
import MenuItem from "@mui/material/MenuItem";
import Menu from "@mui/material/Menu";
import { ExpandMore } from "@mui/icons-material";
import axios from "axios";

function Images() {
  const [sensors, setSensors] = useState([]);
  const [selectedSensor, setSelectedSensor] = useState(null);
  const [anchorEl, setAnchorEl] = useState(null);

  useEffect(() => {
    axios
      .get("http://3.145.131.67:8000/syssen/data/")
      .then((response) => {
        // Get the unique sensor keys
        const uniqueSensors = [
          ...new Set(response.data.map((data) => data.sensor)),
        ];
        setSensors(uniqueSensors);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  const handleOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleSelect = (event, sensor) => {
    setSelectedSensor(sensor);
    handleClose();
  };

  return (
    <div //parent div for ALL COLUMNS
      style={{
        display: "flex",
        justifyContent: "space-between",
        height: "100vh",
        flexWrap: "wrap", // Allow the boxes to wrap if the screen size is too small
      }}
    >
      {/* STYLE FOR COLUMN ONE */}
      <div
        style={{
          backgroundColor: "transparent",
          height: "100%",
          display: "flex",
          flexDirection: "column", // this makes it so all the boxes in column 1 are stacked like a column on top of each other
          alignItems: "center",
          justifyContent: "center",
          flex: "1", // Give equal width to each box
          minWidth: "calc(33.333% - 10px)", // Calculate the width for each box, considering the space between them
          margin: "0 5px", // Set horizontal margin to 5px for equal spacing
          marginBottom: "10px", // Set vertical margin between wrapped boxes
        }}
      >
        {/* box that surrounds fielddock logo */}
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            width: "85%", // Set width to 100% of the parent
            height: "100px",
            backgroundColor: "transparent",
          }}
        >
          <object
            data="../../assets/FieldDock-Logo.svg"
            type="image/svg+xml"
            style={{ maxWidth: "100%", maxHeight: "100%" }} // Apply maxWidth and maxHeight directly to the object
            // Remove fixed width and height values
          />
        </div>
        <div style={{ width: "85%" }}>
          <div
            style={{
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
              width: "100%",
              height: "40px",
              backgroundColor: "transparent",
              border: "1px solid #00e1b4",
              padding: "10px",
              justifyContent: "space-between",
              marginTop: "3rem",
              borderRadius: "5px",
              fontSize: "1vw", // dynamic font size based on viewport width
            }}
            onClick={handleHangerOpen}
          >
            {selectedHangerSystem
              ? selectedHangerSystem
              : "Select Hanger System..."}
            <ListItemIcon>
              <ExpandMore />
            </ListItemIcon>
          </div>

          <Menu
            anchorEl={hangerAnchorEl}
            open={Boolean(hangerAnchorEl)}
            onClose={handleHangerClose}
          >
            {hangerSystems.map((system) => (
              <MenuItem
                key={system.id}
                autoFocus={false}
                onClick={(event) =>
                  handleHangerSelect(
                    event,
                    `${system.name} - ${system.location}`
                  )
                }
                sx={{
                  color: "#000000",
                  backgroundColor: "#BEBEBE !important",
                  "&:hover": { backgroundColor: "#EBECF0 !important" },
                }}
              >
                {system.name} - {system.location}
              </MenuItem>
            ))}
          </Menu>
        </div>{" "}
        {/* end of SELECT FIELDDOCK */}
        <div style={{ width: "85%" }}>
          {" "}
          {/* beginning of WIRELESS SENSOR */}
          <div
            style={{
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
              width: "100%",
              height: "40px",
              backgroundColor: "transparent",
              border: "1px solid #00e1b4",
              padding: "10px",
              justifyContent: "space-between",
              marginTop: "3rem",
              borderRadius: "5px",
              fontSize: "1vw", // dynamic font size based on viewport width
            }}
            onClick={handleOpen}
          >
            {selectedSensor ? selectedSensor : "Select Wireless Sensor..."}
            <ListItemIcon>
              <ExpandMore />
            </ListItemIcon>
          </div>
          <Menu
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={handleClose}
          >
            <MenuItem
              autoFocus={false}
              onClick={(event) => handleSelect(event, "FieldDock 0001")}
              sx={{
                color: "#000000",
                backgroundColor: "#BEBEBE !important",
                "&:hover": { backgroundColor: "#EBECF0 !important" },
              }}
            >
              FieldDock 0001
            </MenuItem>
            <MenuItem
              autoFocus={false}
              onClick={(event) => handleSelect(event, "FieldDock 0002")}
              sx={{
                color: "#000000",
                backgroundColor: "#BEBEBE",
                "&:hover": { backgroundColor: "#EBECF0" },
              }}
            >
              FieldDock 0002
            </MenuItem>
            <MenuItem
              autoFocus={false}
              onClick={(event) => handleSelect(event, "FieldDock 0003")}
              sx={{
                color: "#000000",
                backgroundColor: "#BEBEBE",
                "&:hover": { backgroundColor: "#EBECF0" },
              }}
            >
              FieldDock 0003
            </MenuItem>
          </Menu>
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          {/* Plug and Play Sensor START */}
          <Box
            // onClick={() => setShowChart(true)}
            // onBlur={() => setShowChart(false)}
            style={{
              border: "1px solid #797979",
              padding: "10px",
              position: "relative",
              marginTop: "4rem",
              width: "85%", // Changed to 75% of column
              height: "490px",
              borderRadius: "5px",
            }}
          >
            <Box
              style={{
                position: "absolute",
                top: "-15px",
                left: "50%",
                transform: "translateX(-50%)",
                backgroundColor: "#181818",
                padding: "0 5px",
                zIndex: 1,
                fontSize: "1vw", // dynamic font size based on viewport width
              }}
            >
              Plug and Play Sensor
            </Box>
            <div>
              {/* "Select sensor....START" */}
              <Box
                sx={{
                  //styling for the "Select a sensor box"
                  border: "1px solid #00e1b4",
                  borderRadius: "4px",
                  padding: "10px",
                  display: "flex",
                  justifyContent: "space-between",
                  alignItems: "center",
                  maxWidth: "100%", // Changed to 100% to shrink proportionally
                  maxHeight: "100%", // Changed to 100% to shrink proportionally
                  marginTop: "1rem",
                  height: "30px",
                  backgroundColor: "transparent",
                  borderRadius: "5px",
                  fontSize: "1vw", // dynamic font size based on viewport width
                  marginLeft: "10px",
                }}
                onClick={handleOpen2}
              >
                {selectedSensor2 ? selectedSensor2 : "Select a sensor..."}
                <ListItemIcon>
                  <ExpandMore />
                </ListItemIcon>
              </Box>
              <Menu
                anchorEl={anchorEl2}
                open={Boolean(anchorEl2)}
                onClose={handleClose2}
              >
                {sensors.length > 0 ? (
                  // Get the unique devices from the sensors array
                  [...new Set(sensors.map((sensor) => sensor.device))].map(
                    (device) => (
                      <MenuItem
                        key={device}
                        onClick={(event) =>
                          handleSelect2(event, `Device ${device}`)
                        }
                        sx={{
                          color: "#000000",
                          backgroundColor: "#BEBEBE !important",
                          "&:hover": { backgroundColor: "#EBECF0 !important" },
                        }}
                      >
                        Device {device}
                      </MenuItem>
                    )
                  )
                ) : (
                  <MenuItem
                    disabled
                    sx={{
                      color: "#000000",
                      backgroundColor: "#BEBEBE !important",
                      "&:hover": { backgroundColor: "#EBECF0 !important" },
                    }}
                  >
                    No sensors available
                  </MenuItem>
                )}
              </Menu>
              {/* "Select soil sensor....END" */}
              {/* Table START */}
              <Box
                sx={{
                  marginTop: "1rem",
                  width: "100%",
                  overflow: "auto",
                }}
              >
                <div
                  style={{
                    height: "400px",
                    overflow: "auto",
                    fontSize: "0.8vw",
                  }}
                >
                  <table style={{ width: "100%", tableLayout: "fixed" }}>
                    <thead>
                      <tr>
                        <th
                          style={{
                            color: "#e8e8e8",
                            width: "25%",
                            padding: "10px",
                          }}
                        >
                          ID:
                        </th>
                        <th
                          style={{
